export default(req,res) => {
    const todos = [
        {
            name:'todo1'
        },
        {
            name:'todo2'
        }
    ]

    const {params} = req;
    console.log(params);
    res.statusCode = 200
    res.setHeader('Content-Type', 'application/json')
    res.end(JSON.stringify(todos))
}
